measurements.description:
Twelve flowers clustered at the top of one very strong 26-cm inflorescence;
	sepals cream-white suffused rose pink, spotted dark pink, green distal tip;
	petals cream-white suffused dark pink, distal half spotted darker pink;
	lip cream-white, side lobes blushed pink, midlobe overlaid dark purple distally;
	column cream-white, blushed pink margins, anther cap cream-white, pink spot;
    substance firm; texture matte.
